@StanfordEng's Ingmar Riedel-Kruse and colleagues developed a technique to pattern the growth of biofilms - think plaque on teeth - using bioengineered bacteria that stick to a surface in response to a particular wavelength of light. The technique could clarify how biofilms grow and lead to the development of novel biomaterials or synthetic microbial communities that could be implemented in small devices or systems, such as microfluidic chips or biofilm-based circuits.
